import React, { useEffect } from "react";
import {
  StudyBoard,
  ReservationRoominfo,
  StudyBoardPagination,
  LectureRoominfo,
  MainCarousel,
  NotificationBoard
} from "../components";
import { makeStyles } from "@material-ui/core/styles";
import { SwotMap } from "../containers";
import { Row, Col, Card, Typography, Divider } from "antd";

import Map from "../containers/Map";

const useStyles = makeStyles({
  // ["@media (max-width:780px)"]: {
  //   map: {
  //     display: "none",
  //     backgroundColor: "red"
  //   }
  // }
});

const { Text } = Typography;

const Home = () => {
  const classes = useStyles();
  const NotificationTitle = (
    <div style={{ textAlign: "center" }}>
      <Text type="danger" style={{ fontSize: "20px" }}>
        공지사항
      </Text>
    </div>
  );
  const SWOTMapTitle = (
    <div style={{ textAlign: "center" }}>
      <Text type="danger" style={{ fontSize: "20px" }}>
        SWOT MAP
      </Text>
    </div>
  );

  return (
    <>
      <MainCarousel />
      <div>
        <Row gutter={24} type="flex">
          <Card bordered={false} style={{ marginTop: "50px" }}>
            <Card
              title={NotificationTitle}
              style={{ marginBottom: "50px" }}
              extra={<a href="Notification">Notification ></a>}
            >
              <Text>
                SWOT[안내] 홈페이지 점검 안내 공지 2018.09.21(토) 09:00 ~ 10:00
              </Text>
              <Divider />
              <Text>SWOT[안내] SWOT 멤버십 앱 다운로드 정상화 완료</Text>
              <Divider />
              <Text>SWOT[안내] 앱 다운로드 오류 안내</Text>
            </Card>
            <Col xs={24} md={12}>
              <StudyBoard />
            </Col>
            <Col xs={24} md={12} style={{ marginBottom: "70px" }}>
              <StudyBoard />
            </Col>
            <div style={{ textAlign: "center" }}>
              <StudyBoardPagination />
            </div>
          </Card>
          <div>
            <Card
              extra={<a href="reservation">Lecture ></a>}
              title={SWOTMapTitle}
              hoverable
              style={{
                textAlign: "center",
                marginTop: "74px"
              }}
            >
              <Col xs={24} md={12}>
                <SwotMap />
                <ReservationRoominfo />
              </Col>
            </Card>
          </div>
        </Row>
      </div>
    </>
  );
};
export default Home;
